package puji.wahyono.beans;

public class Menu2 {

	private String ke, ikon, isi;

	public Menu2() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Menu2(String ke, String ikon, String isi) {
		super();
		this.ke = ke;
		this.ikon = ikon;
		this.isi = isi;
	}

	public String getKe() {
		return ke;
	}

	public void setKe(String ke) {
		this.ke = ke;
	}

	public String getIkon() {
		return ikon;
	}

	public void setIkon(String ikon) {
		this.ikon = ikon;
	}

	public String getIsi() {
		return isi;
	}

	public void setIsi(String isi) {
		this.isi = isi;
	}

}
